import './App.css';
import Navbar from './NavBar';
import Forecast from './Forecast';

function App() {
  const title = "Historicast"
  const tagLine = "See forcasts from the past"
  return (
    <div className="App">
      <Navbar />
      <Forecast />
      <div className="content">
        <h1>{ title }</h1>
        <p>{ tagLine }</p>
      </div>
    </div>
  );
}

export default App;
